import './item-filter.css';

const ItemFilter = ({ todos, done,}) => {

    return(
        <div>
            <h3>(</h3>
                <div className ='btn-group'>
                    <button>All</button>
                    <button>Active</button>
                    <button>Complete</button>            
                </div>
            <button>Clear All</button>
        </div>
    )
};

export default ItemFilter;
